snippet.description:
SAAAAAAAALVE, GALERA! É isso mesmo que você leu no título: AMONG US DA VIDA REAL EM UM SHOPPING CENTER!!!! Achamos que a mansão estava pequena demais, então arrumamos um shopping gigante da Rede BR Malls, que é uma administradora de shoppings espalhados no Brasil inteiro! Confere aí esse vídeo que tá DEMAIS, com tasks novas e muita estratégia envolvida!

Confira todos os shoppins da Rede BR Malls: https://linktr.ee/shoppingsbrmalls

Nossas redes estão no comentário fixado. Vai lá nos comentários!

